// App.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Homepage from './components/Homepage';
import RestaurantList from './components/RestaurantList';
import EditRestaurant from './components/EditRestaurant';
import Login from './components/Login';
import Register from './components/Register';
import WinnerDisplay from './components/WinnerDisplay';
import UserProfile from './components/UserProfile'; 
import PastWinnerList from './components/PastWinnerList';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    // Check for token in local storage or perform a token validation check
    const token = localStorage.getItem('access_token');
    setIsAuthenticated(!!token);
  }, []);

  const ProtectedRoute = ({ element }) => (
    isAuthenticated ? element : <Navigate to="/login" />
  );

  return (
    <Router>
      <Navbar />
      <div className="container">
        <Routes>
          <Route path="/" element={<Homepage />} />
          <Route path="/restaurants" element={<ProtectedRoute element={<RestaurantList />} />} />
          <Route path="/edit-restaurant/:id" element={<ProtectedRoute element={<EditRestaurant />} />} />
          <Route path="/login" element={<Login onLogin={() => setIsAuthenticated(true)} />} />
          <Route path="/register" element={<Register />} />
          <Route path="/winner" element={<ProtectedRoute element={<WinnerDisplay />} />} />
          <Route path="/pastwinnerlist" element={<ProtectedRoute element={<PastWinnerList />} />} />
          <Route path="/profile" element={<ProtectedRoute element={<UserProfile />} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;











